DROP TABLE IF EXISTS `v_venda`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `v_venda` (
  `v_id` bigint(13) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `v_cliente` int(10) unsigned NOT NULL DEFAULT '0',
  `v_caixa` int(10) unsigned DEFAULT '0',
  `v_atendente` int(10) unsigned DEFAULT '0',
  `v_status` enum('ABERTO','CONSUMADO','DEVOLUCAO') NOT NULL DEFAULT 'ABERTO',
  `v_total` double(9,2) DEFAULT '0.00',
  `v_forma_pagamento` enum('DINHEIRO','NIBBLE') NOT NULL DEFAULT 'DINHEIRO',
  `v_origem` enum('CAIXA','INTERNET','APP') NOT NULL DEFAULT 'CAIXA',
  `v_data_consumo` datetime DEFAULT NULL,
  `v_data` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `v_data_devolucao` datetime DEFAULT NULL,
  PRIMARY KEY (`v_id`,`v_cliente`),
  KEY `fk_cliente` (`v_cliente`),
  KEY `fk_funcionario` (`v_caixa`),
  CONSTRAINT `v_venda_ibfk_1` FOREIGN KEY (`v_cliente`) REFERENCES `c_cliente` (`c_id`) ON UPDATE CASCADE,
  CONSTRAINT `v_venda_ibfk_2` FOREIGN KEY (`v_caixa`) REFERENCES `f_funcionario` (`f_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=79 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

